import React, { Component } from 'react';
import background from './public/images/moviesBG.png';




class Home extends Component {
    render() {
     
        return (
            <div style={{ backgroundImage: `url(${background})` }} >
                
               
        <h1> Online Movie Ticket Booking </h1>
      
                
                
            </div>
        );
    }
}

export default Home;
